INSERT INTO ideas VALUES(7,'flower app','Well my partner and I used to do this thing where we would pick flowers for each other, and give them to each other, but then we started thinking that its kind of bad to be picking random flowers, because like the bees. So we started doing this thing, where when we are walking around, and we see a flower, we point at it and say this one is for you. This idea expands on that concept and turns it into a phone app, where you can take a picture of a flower and send it to a friend, just to let them know you are thinking about them',NULL,'personal','seedling','2025-07-24 09:52:28','2025-07-24 09:52:28');
